    return (    
      <div className="App">
        <Particles
          options={{particlesOptions}}
        />
        <Navigation />
        <Logo />
        <Rank />
        <ImageLinkForm />
        {/*
        <FaceRecognition />*/}
      </div>
    );

  }
}


